import React from "react";
import ReactDOM  from "react-dom";
import "./index.css";
var time = new Date().getHours()
var greet = ''
if(time > 7 && time < 11){
  greet = "Good Morning"
}else if (time =>11 && time < 19) {
  greet = "Good Afternoon"
} else {
  greet = "Good night"
};

ReactDOM.render(
  <>
    <h1 className="header">Hello Sir {greet}</h1>
    <h2 className="header"> time is {time} </h2>
  </>,
  document.getElementById("root")
)
